      </div>
    );
  }

  componentDidMount() {
    // this.props.setActiveProject(this.props.match.params.id);
  }
}

const mapDispatchToProps = (dispatch) => {
  return {
    setActiveProject: (id) => dispatch(setActiveProject(id)),
  };
};

export default connect(null, mapDispatchToProps)(ProjectPage);
